import React from "react";
import logo from "./logo.svg";
import "./App.css";
import HideAppBar from "./components/AppBar";
import RecipeReviewCard from './components/CityCard'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <HideAppBar />
        <RecipeReviewCard/>
      </header>
    </div>
  );
}

export default App;
